import * as React from 'react';
import Box from '@mui/material/Box';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';
import RestoreIcon from '@mui/icons-material/Restore';
import FavoriteIcon from '@mui/icons-material/Favorite';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import './BottomNav.css'
import { Movie, Whatshot } from '@mui/icons-material';


export default function SimpleBottomNavigation() {
  const [value, setValue] = React.useState(0);

  return (
    <Box className='navBar'>
      <BottomNavigation
        showLabels
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
      >
        <BottomNavigationAction style={{backgroundColor:"rgb(246,9,9)", color:"white"}} label="Trending" icon={<Whatshot />} />
        <BottomNavigationAction style={{backgroundColor:"rgb(246,9,9)", color:"white"}} label="Favorites" icon={<Movie />} />
        <BottomNavigationAction style={{backgroundColor:"rgb(246,9,9)", color:"white"}} label="Nearby" icon={<LocationOnIcon />} />
        <BottomNavigationAction style={{backgroundColor:"rgb(246,9,9)", color:"white"}} label="Nearby" icon={<LocationOnIcon />} />
      </BottomNavigation>
    </Box>
  );
}
